  false,\n\t\"url\": null,\n\t\"notes\": \"NOAA Contract: EA133C11CQ0009NOAA Task
  Order Number: T0013The PSFY13 GA DNR Elevation Data Task Order involves collecting
  and delivering topographic elevation point data derived frommultiple return light
  detection and ranging (LiDAR) measurements in 4 counties in Georgia. The Statement
  of Work (SOW) was developedby the National Oceanic and Atmospheric Administration's
  (NOAA) Coastal Services Center (referred to as the Center) in partnershipwith the
  Georgia Department of Natural Resources (GADNR) Environmental Protection Division
  (EPD). The counties included are Barrow,Clarke, Madison and Oglethorpe. The data
  collected for these 4 counties will exhibit Hydro Flattened DEMs for inclusion into
  the NationalElevation Dataset (NED). The purpose of the data is for use in coastal
  management decision making, including applications such as floodplain mapping and
  water rights management. LiDAR was collected at 1.0 points per square meter (1.0m
  GSD) for Barrow, Clarke, Madison and Oglethorpe Counties.This area was flown during
  snow free and leaf-off conditions.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
